My 3rd day of doing the detox, I woke up following a horrid nightmare combining several trauma points that left me crippled the next day. I have been rapidly moving through the stages of grief, almost as if to repeat it for the incomplete attempt from the first time. 

It has forced me to analyze my coping mechanisms and lack thereof, because as it turns out, I hadn't healed from certain things as much as I'd thought. It's forcing me to be vulnerable and honest with not only myself but those I love and facilitate healing. 

Now that I'm in more of a position to allow myself to feel and truly cope rather than burying the feelings, I am turning to my most expressive creative mediums to see me through. 

