The voices for both Batman and The Joker are performed by Sam John.

This scene from The Dark Knight is one of the greatest cinematic works of our time. When I decided to tackle this scene that was so beautifully crafted by Christopher Nolan and elevated to a level of perfection by the Late Heath Ledger and Christian Bale, I knew that I had to give this my all and reach a level of perfection I couldn‚Äôt have previously imagined.

I knew that this scene required patience, focus and a conscious decision to tap into the imagination of the circumstances of these two mortal enemies. With every beat that was performed, I knew I had to embody not just these characters but their pasts, their obstacles and their goals. 

This scene pushed me to my limits and required me to utilize all the skills and techniques I‚Äôve learned over the past two years and has come out even better than I could have hoped for. 

Without a doubt, this video also serves as a tribute to an actor who changed the game not just for superhero movie acting but the entire industry itself, Heath Ledger.

I am beyond humbled to present to you all my take on The Interrogation Scene from The Dark Knight.

